### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Probability Distributions**
   - **Discrete Random Variables:**
     - **Uniform (Discrete):** \( P(X = k) = \frac{1}{n} \), \( E[X] = \frac{a+b}{2} \), \( Var(X) = \frac{n^2-1}{12} \)
     - **Bernoulli:** \( P(X = k) = p^k (1-p)^{1-k} \), \( E[X] = p \), \( Var(X) = p(1-p) \)
     - **Binomial:** \( P(X = k) = ^nC_k p^k (1-p)^{n-k} \), \( E[X] = np \), \( Var(X) = np(1-p) \)
     - **Geometric:** \( P(X = k) = (1-p)^{k-1} p \), \( E[X] = \frac{1}{p} \), \( Var(X) = \frac{1-p}{p^2} \)
     - **Poisson:** \( P(X = k) = \frac{e^{-\lambda} \lambda^k}{k!} \), \( E[X] = \lambda \), \( Var(X) = \lambda \)

   - **Continuous Random Variables:**
     - **Uniform (Continuous):** \( f_X(x) = \frac{1}{b-a} \), \( E[X] = \frac{a+b}{2} \), \( Var(X) = \frac{(b-a)^2}{12} \)
     - **Exponential:** \( f_X(x) = \lambda e^{-\lambda x} \), \( E[X] = \frac{1}{\lambda} \), \( Var(X) = \frac{1}{\lambda^2} \)
     - **Normal:** \( f_X(x) = \frac{1}{\sigma \sqrt{2\pi}} e^{-\frac{(x-\mu)^2}{2\sigma^2}} \), \( E[X] = \mu \), \( Var(X) = \sigma^2 \)
     - **Gamma:** \( f_X(x) = \frac{\beta^\alpha}{\Gamma(\alpha)} x^{\alpha-1} e^{-\beta x} \), \( E[X] = \frac{\alpha}{\beta} \), \( Var(X) = \frac{\alpha}{\beta^2} \)
     - **Beta:** \( f_X(x) = \frac{\Gamma(\alpha+\beta)}{\Gamma(\alpha)\Gamma(\beta)} x^{\alpha-1} (1-x)^{\beta-1} \), \( E[X] = \frac{\alpha}{\alpha+\beta} \), \( Var(X) = \frac{\alpha \beta}{(\alpha+\beta)^2 (\alpha+\beta+1)} \)

#### 2. **Inequalities and Theorems**
   - **Markov’s Inequality:** \( P(X \geq c) \leq \frac{\mu}{c} \)
   - **Chebyshev’s Inequality:** \( P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)
   - **Weak Law of Large Numbers:** \( P(|\overline{X} - \mu| > \delta) \leq \frac{\sigma^2}{n\delta^2} \)
   - **Central Limit Theorem (CLT):** \( \frac{Y - n\mu}{\sqrt{n\sigma}} \approx \text{Normal}(0, 1) \)

#### 3. **Moment Generating Functions (MGF)**
   - **MGF of Bernoulli:** \( M_X(t) = 1 - p + pe^t \)
   - **MGF of Centralized Bernoulli:** \( M_{X - \mu}(t) = e^{-0.3t} (0.7 + 0.3e^t) \)

#### 4. **Joint Distributions and Independence**
   - **Joint PMF and PDF:** Understanding joint probability mass functions and probability density functions.
   - **Independence:** \( X \) and \( Y \) are independent if \( f_{X,Y}(x,y) = f_X(x) f_Y(y) \).

#### 5. **Sample Mean and Variance**
   - **Expected Value of Sample Mean:** \( E[\overline{X}] = \mu \)
   - **Variance of Sample Mean:** \( Var(\overline{X}) = \frac{\sigma^2}{n} \)

#### 6. **Conditional Probability and Expectation**
   - **Conditional PDF:** Understanding conditional probability density functions.
   - **Conditional Expectation:** \( E[Y | X = x] \)

